class Avatar extends Parse.Object {
  constructor() {
    super('Avatar');
  }

  static async randomPickAvatar() {
    const query = new Parse.Query('Avatar');
    const avatarsCount = await query.count({ useMasterKey: true });

    const randomIndex = Math.floor(Math.random() * avatarsCount);

    query.limit(1);
    query.skip(randomIndex);

    const pickedAvatar = await query.first();
    return pickedAvatar;
  }

  static async fetchAvatars(req) {
    const Avatar = Parse.Object.extend('Avatar');
    const avatarQuery = new Parse.Query(Avatar);

    try {
      const avatars = await avatarQuery.find({ useMasterKey: true });
      const avatarData = avatars.map((avatar) => ({
        objectId: avatar.id,
        url: avatar.get('file').url(), // Assuming your avatars are stored as files
      }));

      return avatarData;
    } catch (error) {
      throw new Error('Error fetching avatars: ' + error.message);
    }
  }

  static async devCreateAvatars(req) {
    const data = {
      base64:
        '',
    };
    const name = 'photo.jpg';
    const file = new Parse.File(name, data);

    await file.save({ useMasterKey: true });

    const Avatar = Parse.Object.extend('Avatar');

    let avatars = [];

    for (let i = 0; i <= 19; i++) {
      const newObject = new Avatar();
      newObject.set('file', file);
      avatars.push(newObject);
    }
    await Parse.Object.saveAll(avatars);
  }

  static registerClass() {
    Parse.Object.registerSubclass('Avatar', Avatar);
  }
}

module.exports = Avatar;
